import React from 'react';

function ListItem(props) {
  return(
    <li>
      <h2>{props.item.title}</h2>
      <div>
        <img src={props.item.thumbnail} alt="bookcover"/>
        <div>
          <span>Author: {props.item.author}</span>
          <p>{props.item.description}</p>
        </div>
      </div>
    </li>
  )
}


export default ListItem;
